import { Link } from 'react-router-dom';

const navBar =() => {
    return(
        <nav className="nav-wrapper grey darken-1">
            <div className="container">
                <Link to='/' className="brand-logo">סולם לעתיד</Link>

            </div>
        </nav>    
    )
}

export default navBar;
